import React from 'react';

import { BrouserRouter, Switch, Router } from 'react-router-dom';

import Main from './pages/main'

const Routes = () => (

    <BrouserRouter>
        <Switch>
            <Router path="/" component={Main} />
        </Switch>
    </BrouserRouter>

);
